निर्माणाधीन कोहलपुर&amp;ndash;सुर्खेत १३२ केभी प्रसारण लाइनको काम अन्तिम चरणमा पुगेको छ । यही माघ २० गतेभित्रमा चार्जिङ गर्ने तयारीका साथ धमाधम काम भइरहेको छ ।
&amp;nbsp;
आयोजना प्रमुख रवि चौधरीका अनुसार अब ५०० मिटर तार तान्न बाँकी छ ।&amp;nbsp;

छ व

आगामी फागुन २१ गते हुने प्रतिनिधिसभाको निर्वाचनका लागि नेपाल मजदुर किसान पार्टी (नेमकिपा)ले ५९ जिल्लाका १२० निर्वाचन क्षेत्रमा आफ्नो उम्मेदवारी दिएको छ ।&amp;nbsp;
&amp;nbsp;&amp;nbsp; &amp;nbsp;
नेमकिपाले ६७ पुरुष र ५३ महिलालाई उम्मेदवार बनाएको पार्

काठमाडौँ । सञ्चार तथा सूचना प्रविधिमन्त्री जगदिश खरेलले पदबाट राजीनामा दिएका छन् ।

ललितपुर-२ बाट प्रतिनिधिसभा सभा निर्वाचन लड्ने निश्चित भएपछि खरेलले प्रधानमन्त्री सुशीला कार्कीलाई राजीनामा पत्र बुझाएका हुन् ।&amp;nbsp;

